import './App.css';
import { Route, Routes } from 'react-router-dom';
import { MainPage } from './pages/MainPage';
import { AppOutlet } from './components/Outlet/AppOutlet';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route  path='/' element={<AppOutlet/>}>
        <Route index element={<MainPage />}></Route>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
